oxy_webhelp_navlinks = {"cal_access.dita-d4800e2796":{"topics":[{"title":"Who can see my schedule and free time information?","shortdesc":"<p class=\"shortdesc\">You can set a preference to determine whether, or how much of, your schedule information displays when other people schedule meetings and check to see your busy and free times.<\/p>","href":"cal_who_view_schedule_t.html","attributes":{"data-id":"cal_who_view_schedule_t"},"menu":{"hasChildren":false},"tocID":"cal_who_view_schedule_t-d4800e2807","topics":[]},{"title":"How do I give someone access to manage my calendar?","shortdesc":"<p class=\"shortdesc\">You can let specified people open your mail, calendar, to do, or contact entries. You can also let people send, edit (including adding a follow-up flag), and delete messages, create and delete calendar entries, and create and delete to do items for you.<\/p>","href":"cal_access_t.html","attributes":{"data-id":"pref_delegate_mailcaltodocon_t"},"menu":{"hasChildren":false},"tocID":"pref_delegate_mailcaltodocon_t-d4800e2818","topics":[]},{"title":"How do I open another person's calendar?","shortdesc":"<p class=\"shortdesc\">You can read or edit another person's calendar or to do list if the person has given you access to do so.<\/p>","href":"cal_open_others_t.html","attributes":{"data-id":"cal_open_others_t"},"menu":{"hasChildren":false},"tocID":"cal_open_others_t-d4800e2829","topics":[]},{"title":"How do I create a shortcut to another person's Calendar?","shortdesc":"<p class=\"shortdesc\">You can create shortcuts to someone's NotesÂ® mail, calendar, to do, or contacts, if that person has given you access.<\/p>","href":"cal_shortcut_t.html","attributes":{"data-id":"pref_cr_shortcuts_others_mail_t"},"menu":{"hasChildren":false},"tocID":"pref_cr_shortcuts_others_mail_t-d4800e2840","topics":[]},{"title":"How do I forward meeting invitations to another person automatically?","shortdesc":"<p class=\"shortdesc\">You can forward  meeting invitations and notices you receive to a specified person or group, so they can manage your schedule.<\/p>","href":"cal_forward_t.html","attributes":{"data-id":"cal_show_placeholder"},"menu":{"hasChildren":false},"tocID":"cal_show_placeholder-d4800e2854","topics":[]}]}};